def example_similarity_matching():
    """
    相似度匹配示例
    """
    print("相似度匹配示例：")
    print("-" * 30)
    
    # 包含识别错误的数据
    redundant_data = [
        {"conf": 0.9, "end": 1.0, "start": 0.0, "word": "机器学习"},
        {"conf": 0.7, "end": 2.0, "start": 1.0, "word": "机械学习"},  # 识别错误
        {"conf": 0.95, "end": 3.0, "start": 2.0, "word": "很"},
        {"conf": 0.9, "end": 4.0, "start": 3.0, "word": "有趣"}
    ]
    
    target_text = "机器学习很有趣"
    
    # 使用较低的相似度阈值来匹配识别错误的词语
    result = match_and_filter(redundant_data, target_text, similarity_threshold=0.6)
    
    print(f"目标文本：{target_text}")
    print(f"匹配结果：{len(result)} 个词语")
    print("匹配的词语：")
    for item in result:
        print(f"  - {item['word']} (置信度: {item['conf']})")
    print()


