def example_algorithm_comparison():
    """
    算法比较示例
    """
    print("算法比较示例：")
    print("-" * 30)
    
    redundant_data = [
        {"conf": 1.0, "end": 1.0, "start": 0.0, "word": "人工"},
        {"conf": 0.9, "end": 2.0, "start": 1.0, "word": "智能"},
        {"conf": 0.8, "end": 3.0, "start": 2.0, "word": "技术"},
        {"conf": 0.7, "end": 4.0, "start": 3.0, "word": "发展"},
        {"conf": 0.6, "end": 5.0, "start": 4.0, "word": "很快"}
    ]
    
    target_text = "人工智能技术发展很快"
    
    # 使用动态规划算法
    dp_result = match_and_filter(redundant_data, target_text, use_dp=True)
    
    # 使用贪心算法
    greedy_result = match_and_filter(redundant_data, target_text, use_dp=False)
    
    print(f"目标文本：{target_text}")
    print(f"动态规划算法结果：{len(dp_result)} 个词语")
    print(f"贪心算法结果：{len(greedy_result)} 个词语")
    
    print("\n两种算法的结果是否相同：", dp_result == greedy_result)
    print()


